      {text1: 'Doing my first ever assignment in ReactJs'},
      {text2: 'I intend to do it without help as much as possible'},
      {user}
    ]
  };


  render() {
    return (
        <div className="App">
          <h1>Assignment 1</h1>
          <UserOutput para1={this.state.paragraphs[0].text1}/>
